/* eslint-disable react/react-in-jsx-scope */
import { Navigate, Route, Routes } from 'react-router-dom';
import { useDrawerContext } from '../shared/contexts';
import { useEffect } from 'react';
import { Home, Map, PeopleAlt } from '@mui/icons-material';
import {
  Dashboard,
  DetalheDePessoas,
  ListagemDePessoas,
  ListagemDeCidades,
  DetalheDeCidades,
} from '../pages';

export const AppRoutes = () => {
  const { setDrawerOptions } = useDrawerContext();

  useEffect(() => {
    // Função utilizada para executar uma tarefa apenas uma vez idenpendente de novos fluxos de render.
    setDrawerOptions([
      {
        label: 'Página Inicial',
        path: '/home',
        icon: Home,
      },
      {
        label: 'Cidades',
        path: '/cidades',
        icon: Map,
      },
      {
        label: 'Pessoas',
        path: '/pessoas',
        icon: PeopleAlt,
      },
    ]);
  }, []);

  return (
    <Routes>
      <Route
        path='/home'
        element={<Dashboard />}
      />

      <Route path='/happy-game' element
      ></Route>

      <Route
        path='/pessoas'
        element={<ListagemDePessoas />}
      />
      <Route
        path='/pessoas/detalhe/:id'
        element={<DetalheDePessoas />}
      />

      <Route
        path='/cidades'
        element={<ListagemDeCidades />}
      />
      <Route
        path='/cidades/detalhe/:id'
        element={<DetalheDeCidades />}
      />

      <Route
        path='*'
        element={<Navigate to='/home' />}
      />
    </Routes>
  );
};
